<>
<h1>Hello.. Gud morning</h1>
<Card 
imgsrc="https://pbs.twimg.com/profile_images/888341377729273856/OJGYfJTs_400x400.jpg"
title={Mobiles[1].title}
/>
</>,
document.getElementById('root')
);
